import { Grid } from "@mui/material";
import React, { useEffect } from "react";
import { useDispatch } from "react-redux";
import { artistActions } from "../../../../../../state/actions";

const SingleCategory = ({ artistType, title }) => {
  const dispatch = useDispatch();
  currCategoryArtistInfo;
  const currArtist = useSelector((state) => state.artist.currArtist);

  useEffect(() => {
    try {
      dispatch(artistActions.currCategoryArtistInfo(artistType, title));
    } catch (error) {
      console.log("error is " + error.message);
    }
  }, []);
  return (
    <Grid sx={{ m: 1 }} container spacing={2}>
      <Grid item xs={12} sm={6}>
        Single Category
      </Grid>
    </Grid>
  );
};

export default SingleCategory;
